import React from 'react';
import Header2 from './Header2';
import ContainerContact from './img-contact';
import imgContact2 from './img-contact2';
export default function Page2() {



    let airbnb = imgContact2.map(contact => {

        return <ContainerContact img={contact.img} name={contact.name}
            rating={contact.rating} data={contact.data} cost={contact.cost} />


    })
    console.log(airbnb)
    return (

        <div>
            <Header2 />

            <div className='containerContainerContact'>

                {airbnb}


            </div>
        </div>





    )
}
